import React from 'react';

const addClass = (WrappedComponent: React.FC, className: string) => {
    const hasClicked = () => {
        console.log('print!');
    };
    return (props:any) => (
        <div className={className}>
            <WrappedComponent {...props} clicked={hasClicked}>{props.children}</WrappedComponent>
        </div>
    );
};

export default addClass;
